    func test1() throws {
        let m32 = MT32(seed: UInt32(0))
        for i in 0 ..< randomValues1.count {
            XCTAssertEqual(randomValues1[i], m32.nextUInt32())
        }
        for i in 0 ..< randomDouble1.count {
            XCTAssertEqual(Double(bitPattern: randomDouble1[i]), m32.nextDouble(open: true))
        }
    }

    func test2() throws {
        let m32 = MT32(seed: [UInt32(0x123), 0x234, 0x345, 0x456])
        for i in 0 ..< randomValues2.count {
            XCTAssertEqual(randomValues2[i], m32.nextUInt32())
        }
        for i in 0 ..< randomDouble2.count {
            XCTAssertEqual(Double(bitPattern: randomDouble2[i]), m32.nextDouble(open: true))
        }
    }

    func test64() throws {
        let mt32 = MT32()
        let state = mt32.getState()
        let x64 = mt32.nextUInt64()
        mt32.setState(state: state)
        let x32x2 = UInt64(mt32.nextUInt32()) << 32 | UInt64(mt32.nextUInt32())
        XCTAssertEqual(x64, x32x2)
    }
    
    func testCopy() throws {
        let mt32 = MT32()
        let mtx = MT32(mt: mt32)
        XCTAssertEqual(mt32, mtx)
        XCTAssertEqual(mt32.nextDouble(), mtx.nextDouble())
    }

